import React,{Component} from 'react';
class Head extends Component
{
 render(){

 return(

<div>
        <ul className="menu">
                <li>HOME</li>
                <li>PRODUCT</li>
                <li>ABOUT</li>
                <li>CONTACT</li>
                <li>HELP</li>
        </ul>
</div>
 )

 }


}

export default Head;
